        <a [routerLink]="'.'" class="p-0 float-end"
          >Export <i class="uil uil-export ms-1"></i
        ></a>
        <h4 class="card-title header-title" i18n>Views Per Minute</h4>
        <div class="table-responsive table-nowrap mt-2">
          <table class="table mb-0">
            <thead>
              <tr>
                <th i18n>Page</th>
                <th i18n>Bounce Rate</th>
                <th i18n>Traffic Type</th>
                <!-- <th>Status</th> -->
              </tr>
            </thead>
            <tbody>
              <tr *ngFor="let view of viewDetails">
                <td>
                  <a href="javascript:void(0);" class="text-muted">{{
                    view.page
                  }}</a>
                </td>
                <td>{{ view.bounce_rate }}</td>
                <td>
                  <ul class="list-inline mb-0">
                    <li class="list-inline-item">
                      <i class="uil uil-desktop"></i>
                    </li>
                    <li class="list-inline-item">
                      <i class="uil uil-mobile-android-alt"></i>
                    </li>
                    <li class="list-inline-item">
                      <i class="uil uil-tablet"></i>
                    </li>
                  </ul>
                </td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
      <!--end card body-->
    </div>
    <!--end card-->
  </div>
  <!--end col-->
  <div class="col-lg-6 col-xl-4">
    <div class="card">
      <div class="card-body">
        <div class="float-end" ngbDropdown placement="bottom-end">
          <a
            ngbDropdownToggle
            class="arrow-none p-0 text-dark"
            id="analyticsDropdown"
            href="javascript:void(0)"
            aria-expanded="false"
          >
            <i class="uil uil-ellipsis-v fs-13"></i>
          </a>
          <div
            ngbDropdownMenu
            class="dropdown-menu-end"
            aria-labelledby="analyticsDropdown"
          >
            <!-- item-->
            <a ngbDropdownItem>
              <i class="uil uil-refresh me-2"></i>Refresh Report
            </a>
            <!-- item-->
            <a ngbDropdownItem>
              <i class="uil uil-export me-2"></i>Export Report
            </a>
          </div>
        </div>

        <h4 class="card-title header-title" i18n>Session by Locations</h4>
        <div class="my-3">
          <app-widget-world-map
            mapId="world-map-markers"
            height="407px"
            width="100%"
            [options]="worldMapConfig"
          >
          </app-widget-world-map>
        </div>
      </div>
      <!--end card body-->
    </div>
    <!--end card-->
  </div>
  <!--end col-->
  <div class="col-lg-6 col-xl-4">
    <div class="card">
      <div class="card-body">
        <div class="float-end" ngbDropdown placement="bottom-end">
          <a
            ngbDropdownToggle
            class="arrow-none p-0 text-dark"
            id="analyticsDropdown"
            href="javascript:void(0)"
            aria-expanded="false"
          >
            <i class="uil uil-ellipsis-v fs-13"></i>
          </a>
          <div
            ngbDropdownMenu
            class="dropdown-menu-end"
            aria-labelledby="analyticsDropdown"
          >
            <!-- item-->
            <a ngbDropdownItem>
              <i class="uil uil-refresh me-2"></i>Refresh Report
            </a>
            <!-- item-->
            <a ngbDropdownItem>
              <i class="uil uil-export me-2"></i>Export Report
            </a>
          </div>
        </div>

        <h4 class="card-title header-title" i18n>Session by Browser</h4>
        <div class="my-3" dir="ltr">
          <div id="session-browser">
            <apx-chart
              class="apex-charts"
              [chart]="browserChart.chart!"
              [series]="browserChart.series!"
              [plotOptions]="browserChart.plotOptions!"
              [colors]="browserChart.colors!"
              [labels]="browserChart.labels!"
              [legend]="browserChart.legend!"
              [responsive]="browserChart.responsive!"
              *ngIf="browserChart"
            >
            </apx-chart>
          </div>
        </div>
        <div>
          <p class="mb-1">
            <i class="uil uil-square text-primary me-1"></i> Safari
            <span class="float-end">32.8%</span>
          </p>
          <p class="mb-1">
            <i class="uil uil-square text-success me-1"></i> Firefox
            <span class="float-end">16.5%</span>
          </p>
          <p class="mb-1">
            <i class="uil uil-square text-danger me-1"></i> Chrome
            <span class="float-end">38.3%</span>
          </p>
          <p class="mb-0">
            <i class="uil uil-square text-warning me-1"></i> Internet Explorer
            <span class="float-end">12.4%</span>
          </p>
        </div>
      </div>
      <!--end card body-->
    </div>
    <!--end card-->
  </div>
  <!--end col-->
</div>
<!--end row-->
